export default function Home() {
  const projects = [
    { title: "Community Clean-Up", desc: "Organizing neighborhood clean-up efforts." },
    { title: "Youth Coding Bootcamp", desc: "Teaching programming to teens." },
    { title: "Food Distribution Drive", desc: "Supporting families in need." },
  ];

  return (
    <div className="bg-gray-100 min-h-screen">
      <div className="text-center py-12">
        <h1 className="text-3xl font-bold text-blue-600">Welcome to Alkarama Hub</h1>
        <p className="text-gray-600 mt-2">Empowering Communities</p>
      </div>

      <div className="max-w-5xl mx-auto px-4">
        <h2 className="text-xl font-semibold text-gray-700 mb-6">Our Projects</h2>
        <div className="grid md:grid-cols-3 gap-6">
          {projects.map((project, index) => (
            <div key={index} className="bg-white p-4 shadow rounded hover:shadow-lg transition">
              <h3 className="text-lg font-bold text-blue-600">{project.title}</h3>
              <p className="text-gray-600 mt-2 text-sm">{project.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
